import { Fragment } from "react"

function NewsCard(props) {
    return (
        <Fragment>
            <h2>{props.title}</h2>
            <img src={props.imgUrl} width="100%" height="80"/>
            <h4>{props.desc}</h4>
            <h5>{props.by}</h5>
        </Fragment>
    )
}

export default NewsCard;
